oxy_webhelp_navlinks = {"data_sources-d23139e41313":{"topics":[{"title":"Rubrik Backup Service","shortdesc":"<p class=\"shortdesc\">The Rubrik Backup Service is software installed on a host that coordinates activity         between the Rubrik cluster and the host.<\/p>","href":"saas\/rubrik_backup_service_3.html","attributes":{"data-id":"rubrik_backup_service"},"menu":{"hasChildren":false},"tocID":"rubrik_backup_service-d23139e41324","next":"rubrik_backup_service-d23139e41324"},{"title":"Guest OS credentials","shortdesc":"<p class=\"shortdesc\">Guest OS credentials are the username and password that a Rubrik cluster uses to         provide access to the guest operating system and files of a vSphere virtual machine. When         Rubrik Backup Service is not installed or disconnected, you can use guest OS credentials to         recover virtual machine files.<\/p>","href":"cdm\/guest_os_credentials_2.html","attributes":{"data-id":"guest_os_credentials"},"menu":{"hasChildren":false},"tocID":"guest_os_credentials-d23139e41468","next":"guest_os_credentials-d23139e41468"}]}};